import React from "react";
import "./styles.css";

const CardPage = () => {
  return (
    <div className="card-page">
      <div className="line-back">
        <button>
          <p>&larr;</p>
          <p>Back to catalog</p>
        </button>
      </div>
      <div className="sneaker-content">
        <div className="mat-images"></div>
        <div className="right"></div>
      </div>
    </div>
  );
};

export default CardPage;
